// AdminPage.jsx

import React, { useState } from 'react';
const AdminPage = () => {
  const [activeMenu, setActiveMenu] = useState('patients');

  const handleMenuClick = (menu) => {
    setActiveMenu(menu);
  };

  return (
    <div className="admin-page">
      <div className="menu-bar">
        <button className={activeMenu === 'patients' ? 'active' : ''} onClick={() => handleMenuClick('patients')}>Patients</button>
        <button className={activeMenu === 'appointments' ? 'active' : ''} onClick={() => handleMenuClick('appointments')}>Appointments</button>
        <button className={activeMenu === 'reports' ? 'active' : ''} onClick={() => handleMenuClick('reports')}>Reports</button>
        {/* Add more menu items as needed */}
      </div>
      <div className="content">
        {activeMenu === 'patients' && <Patients />}
        {activeMenu === 'appointments' && <Appointments />}
        {activeMenu === 'reports' && <Reports />}
        {/* Add more components for other menu items */}
      </div>
    </div>
  );
};

export default AdminPage;
